cql:
library MedX version 'Draft'

using FHIR version '4.0.1'

include PatientUtils version '1.0.0' called PatientUtilsLocal
include FHIRHelpers version '1.0.0' called FHIRHelpers

valueset "Rogaine": 'https://cqlab.io/lab/learn/value-sets/6aaf7bb0-84a7-4d5f-a84e-4e4d3a11aa08' version '1.0.0'
valueset "Heart failure": 'https://cqlab.io/lab/learn/value-sets/a2201bdf-2bb1-4d28-acbb-6341529b9d7c' version '1.0.0'


context Patient

/**
@type: {urn:hl7-org:elm-types:r1}Boolean
*/
define "Is Male": Patient.gender = 'male'

/**
@type: {urn:hl7-org:elm-types:r1}Boolean
@documentation
Checks to see if the patient is over 18 years old
*/
define "Patient is Over 18 Years Old": PatientUtilsLocal."Patient Age" > 18

/**
@type: List {http://hl7.org/fhir}Condition
*/
define "Has history of Heart Failure": [Condition: "Heart failure"]

/**
@type: {urn:hl7-org:elm-types:r1}Boolean
*/
define "Has taken Rogaine in the last 60 days": exists [MedicationDispense: "Rogaine"] MedDispense
  where difference in days between FHIRHelpers.ToDateTime(MedDispense.whenHandedOver) and Today() < 60

/**
@type: {urn:hl7-org:elm-types:r1}Boolean
*/
define "Eligible for MedX": 
  "Is Male"
  and "Patient is Over 18 Years Old" 
  and not exists "Has history of Heart Failure"
  and not "Has taken Rogaine in the last 60 days"

