library PatientUtils version '1.0.0'

using FHIR version '4.0.1'

include DateUtils version '1.0.0' called DateUtils
include FHIRHelpers version '1.0.0' called FHIRHelpers


context Patient

/**
@type: {http://hl7.org/fhir}date
*/
define "Age As String Date": 
  Patient.birthDate

/**
@type: {urn:hl7-org:elm-types:r1}Date
*/
define "Age As Date": 
  FHIRHelpers.ToDate(Patient.birthDate)

/**
@type: {urn:hl7-org:elm-types:r1}Integer
*/
define "Patient Age":
	DateUtils.YearsSinceDate(FHIRHelpers.ToDate(Patient.birthDate))

/**
@type: {urn:hl7-org:elm-types:r1}Boolean
*/
define "Age Greater Than 18":
  "Patient Age" >= 18
